import React, { Component } from 'react';
import { Content, DetailWrapper, Header } from './style';

class Detail extends Component {
  render() { 
    return (
      <DetailWrapper>
        <Header></Header>
        <Content></Content>
      </DetailWrapper>
    );
  }
}

export default Detail;
